import React, { useState, useEffect } from 'react';
import { useHistory } from "react-router-dom";
import '../css/Skills.css';
import {
    Switch,
    Route,
    Link
} from "react-router-dom";

import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

const Skills = () => {

    return <div className='parent1'>
        <div className='expand1'>
            <h1><span className='blur'>LANGUAGES</span></h1>
            
            <Card sx={{ maxWidth: 105 }}>
                <CardMedia component="img" height="100" image="/static/images/cards/contemplative-reptile.jpg" lt="green iguana"/>
                <CardContent>
                    <Typography  variant="h6" component="div">HTML</Typography>
                </CardContent>
            </Card>
            <Card sx={{ maxWidth: 105 }}>
                <CardMedia component="img" height="100" image="/static/images/cards/contemplative-reptile.jpg" lt="green iguana"/>
                <CardContent>
                    <Typography  variant="h6" component="div">HTML</Typography>
                </CardContent>
            </Card>


        </div>
    </div>


}
export default Skills
